// actual code
$(document)
	.ready(function() {
	// map config
	var mapCenter = [50.25, 10];
	var mapZoom = 6;
	var mapMaxZoom = 12;
	var mapMaxBounds = [
		[70, - 15],
		[30, 35]
	];

	// the actual map
	// change the L.tileLayer to use different map tiles,
	// e.g. the URL you get from the CloudMade editor
	var baseLayer = L.tileLayer('http://{s}.tile.cloudmade.com/c92a245f75214baa9572bf5e76922113/98325/256/{z}/{x}/{y}.png', {
		attribution: 'Map data &copy; <a href="http://openstreetmap.org">OpenStreetMap</a> contributors, <a href="http://creativecommons.org/licenses/by-sa/2.0/">CC-BY-SA</a>, Natural Earth, Imagery © <a href="http://cloudmade.com">CloudMade</a>',
		maxZoom: mapMaxZoom
	});

	// icons for markers
	var icon1 = L.icon({
		iconUrl: 'img/1.gif',
		iconSize: [7, 7],
		iconAnchor: [3, 3],
		popupAnchor: [0, 0],
	});
	var icon2 = L.icon({
		iconUrl: 'img/2.gif',
		iconSize: [7, 7],
		iconAnchor: [3, 3],
		popupAnchor: [0, 0],
	});
	var icon3 = L.icon({
		iconUrl: 'img/3.gif',
		iconSize: [7, 7],
		iconAnchor: [3, 3],
		popupAnchor: [0, 0],
	});
	var icon4 = L.icon({
		iconUrl: 'img/4.gif',
		iconSize: [7, 7],
		iconAnchor: [3, 3],
		popupAnchor: [0, 0],
	});

	// extract heatmap data from stations list
	var data = _.map(stations["stations"], function(station) {
		return {
			"lat": station.latitude,
			"lon": station.longitude,
			"value": station["Meldestufe"]
		}
	});

	var heatmapLayer = L.TileLayer.heatMap({
		// radius could be absolute or relative
		// absolute: radius in meters, relative: radius in pixels
		radius: {
			value: 10000,
			absolute: true
		},
		opacity: 1,
		gradient: {
			0: "rgb(243, 255, 0)",
			0.25: "rgb(255, 166, 0)",
			0.75: "rgb(213, 0, 0)",
			1: "rgb(165, 0, 150)",
		}
	});
	heatmapLayer.setData(data);

	// add markers to map
	var markerLayer = L.layerGroup();
	_.each(stations["stations"], function(station, index, list) {
		if (station.latitude && station.longitude) {
			var icon = null;
			switch (station["Meldestufe"]) {
				case 1:
					icon = icon1;
					break;
				case 2:
					icon = icon2;
					break;
				case 3:
					icon = icon3;
					break;
				case 4:
					icon = icon4;
					break;
				default:
					icon = icon1;
			}
			var marker = L.marker([station.latitude, station.longitude], {
				"icon": icon
			});
			marker.bindPopup("<strong>" + station["Station Original"] + "</strong>" + "<br>" + station["Fluss"] + "<br>Meldestufe: " + station["Meldestufe Original"]);
			marker.addTo(markerLayer);
		}
	});

	// timestamp
	var ts = stations["timestamp"].split("-");
	ts = parseInt(ts[2]) + "." + parseInt(ts[1]) + "." + ts[0] + ", " + ts[3] + ":" + ts[4] + " Uhr";
	$("#timestamp")
		.html(ts);

	// (negative) outline for Germany, to dim the other countries
	var outlineStyle = {
		"stroke": false,
		"color": "black",
		"opacity": 0.5,
		"clickable": false
	}
	var germanOutline = L.geoJson(germanyOutline, {
		style: outlineStyle
	});

	// important German rivers
	var riverStyle = {
		"stroke": true,
		"color": "#03f",
		"weight": 2
	}
	var rivers = L.geoJson((fluesse["features"]), {
		style: riverStyle
	});

	// calculate the bounds for the map from all station
	// that have Meldestufe 4
	var alarm4Stationen = _.filter(stations["stations"], function(station) {
		return station["Meldestufe"] == 4;
	});
	alarm4Stationen = _.map(alarm4Stationen, function(station) {
		return [station.latitude, station.longitude]
	});
	var alarm4Bounds = new L.LatLngBounds(alarm4Stationen);

	L.marker([52.54, 12])
		.addTo(markerLayer)
		.bindPopup('Fischbeck')
		.openPopup();

	// initialise map
	var map = new L.Map('map', {
		center: mapCenter,
		zoom: mapZoom,
		layers: [baseLayer, germanOutline, rivers, heatmapLayer, markerLayer],
		attributionControl: false,
		maxBounds: mapMaxBounds
	});
	map.fitBounds(alarm4Bounds);

	// the copyright text in the lower right
	var attributionControl = new L.Control.Attribution({
		"prefix": ""
	});
	attributionControl.addAttribution(baseLayer.getAttribution());
	attributionControl.addTo(map);

	var layerControl = L.control.layers([], {
		"Heatmap": heatmapLayer,
		"Messstationen": markerLayer
	}, {
		"collapsed": false
	});
	layerControl.addTo(map);

	// distance scale
	L.control.scale({
		"imperial": false
	})
		.addTo(map);
});
